import React, { useEffect, useRef } from 'react';
import './About.css';

function About() {
  const timelineRef = useRef(null);
  const sectionRef = useRef(null);

  useEffect(() => {
    const timeline = timelineRef.current;
    const section = sectionRef.current;
    let isScrollingHorizontally = false;
    let lastScrollTop = 0;

    const handleScroll = (e) => {
      const currentScrollTop = window.pageYOffset || document.documentElement.scrollTop;
      
      if (isScrollingHorizontally) {
        e.preventDefault();
        return;
      }

      const timelineRect = timeline.getBoundingClientRect();
      if (timelineRect.top <= 0 && timelineRect.bottom >= window.innerHeight) {
        const scrollLeft = timeline.scrollLeft;
        const maxScrollLeft = timeline.scrollWidth - timeline.clientWidth;

        if (currentScrollTop > lastScrollTop && scrollLeft < maxScrollLeft) {
          // Scrolling down
          isScrollingHorizontally = true;
          e.preventDefault();
          timeline.scrollTo({
            left: scrollLeft + 100,
            behavior: 'smooth'
          });
          setTimeout(() => {
            isScrollingHorizontally = false;
          }, 500);
        } else if (currentScrollTop < lastScrollTop && scrollLeft > 0) {
          // Scrolling up
          isScrollingHorizontally = true;
          e.preventDefault();
          timeline.scrollTo({
            left: scrollLeft - 100,
            behavior: 'smooth'
          });
          setTimeout(() => {
            isScrollingHorizontally = false;
          }, 500);
        }
      }

      lastScrollTop = currentScrollTop <= 0 ? 0 : currentScrollTop;
    };

    window.addEventListener('scroll', handleScroll, { passive: false });
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const skills = [
    'System Design', 'Cybersecurity', 'Cloud Solutions', 
    'AI Integration', 'IT Infrastructure',
  ];

  const funFacts = [
    "I'm on a mission to make the world paperlessâ€”one frustrated fax machine at a time.",
    "I've debugged more code than I've had hot dinners.",
    "I speak fluent Python, Java, and Sarcasm.",
    "My idea of a good time? A quiet evening with a good book on quantum computing."
  ];

  const timeline = [
    { year: '2023', event: 'Completed Generative AI: Prompt Engineering Basics', icon: 'fas fa-robot' },
    { year: '2022', event: 'Launched AI writing and image generation services', icon: 'fas fa-pen-fancy' },
    { year: '2021', event: 'Expanded into cloud solutions and cybersecurity', icon: 'fas fa-cloud-upload-alt' },
    { year: '2020', event: 'Started IT consulting business', icon: 'fas fa-briefcase' },
    { year: '2019', event: 'Obtained Google IT Support certification', icon: 'fab fa-google' },
    { year: '2015', event: 'Began journey in IT', icon: 'fas fa-laptop-code' }
  ];

  return (
    <div className="about" ref={sectionRef}>
      <section className="intro">
        <h1>About Me</h1>
        <p>Growing up in Sudan, I always imagined how technology could transform lives, and now, I'm turning those dreams into reality.</p>
      </section>

      <section className="humor">
        <h2>Meet the Tech Wizard</h2>
        <p>Hi, I'm Ahmed Sharfi, the IT guy who's saved more servers from disaster than Batman has saved Gotham. I specialize in turning tech problems into 'oh-that-was-easy' moments.</p>
      </section>

      <section className="skills">
        <h2>Here's What I Bring to the Table</h2>
        <div className="skill-blobs">
          {skills.map((skill, index) => (
            <div key={index} className="skill-blob">{skill}</div>
          ))}
        </div>
      </section>

      <section className="what-i-do">
        <h2>What I Do</h2>
        <p>From AI writing to cloud solutions, and everything in between, I'm here to help businesses go digital, paperless, and problem-free.</p>
      </section>

      <section className="fun-facts">
        <h2>Things You Didn't Know About Me</h2>
        <ul>
          {funFacts.map((fact, index) => (
            <li key={index}>{fact}</li>
          ))}
        </ul>
      </section>

      <section className="timeline">
        <h2>My Journey</h2>
        <div className="timeline-container" ref={timelineRef}>
          {timeline.map((item, index) => (
            <div key={index} className="timeline-item">
              <div className="timeline-icon">
                <i className={item.icon}></i>
              </div>
              <div className="timeline-content">
                <h3>{item.year}</h3>
                <p>{item.event}</p>
              </div>
            </div>
          ))}
        </div>
      </section>

      <section className="vision">
        <h2>My Vision</h2>
        <p>I believe the world should be digital, paperless, and seamlessâ€”and I'm working every day to make that happen.</p>
        <p>When I'm not busy solving IT problems or generating AI art, you'll find me working on ways to help businesses thrive in the tech-driven world.</p>
      </section>
    </div>
  );
}

export default About;
